import React from "react";

import Navbar from "../navbar/Navbar";
import Map_Tiruppur from "../maps/Map_Tiruppur";
function Tiruppur() {
  return (
    <div>
      <Navbar />
      <Map_Tiruppur />
    </div>
  );
}
export default Tiruppur;
